INSERT INTO `service1` VALUES (2,'2015-08-10 09:28:59','2016-04-02 10:06:57','Health Care',NULL,'1','1',NULL,NULL,'/images/ico/mapicon/srv_health_care.jpg',22,1,0,0,'',NULL,NULL),(3,'2015-08-10 09:28:59','2016-04-23 12:24:26','Doctor','Got a medical emergency in the middle of night? No worries, get the highly professional doctor at your doorstep.','1','158ff822-3af6-4b60-95a9-202c7e73eaae','doctorOrder','  <img  src=\"nbdimages/images/img-1.jpg\" alt=\"doctor image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We guarantee Best Doctors and Specialists at your location</h3><p class = \"textContentId1\"> No more waiting for long hours in Clinics  </p><p class = \"textContentId2\">   No more wasting time in Traffic </p>                 <p class = \"textContentId3\">  No more ignoring of your health for time, company confusion. </p>','/images/ico/mapicon/srv_doctor.jpg',29,0,0,0,'',NULL,'nbdimages/serviceicons/ico_doctor.png'),(4,'2015-08-10 09:28:59','2016-03-17 15:26:35','Electrician','Worried about wiring or need to install a geyser. Our well trained electricians will fixem up within no time.','2','1b867019-e781-4726-930d-e3a44dbb6fac','pathologyOrder','  <img  src=\"nbdimages/images/electrician-1.jpg\" alt=\"electrician image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Is Electricity issue? Non functioning gadgets? Do not worry about it. We are here to fix these issues.</h3><p class = \"textContentId1\"> 100% Safety Guaranteed, Free Service if the problem recurs  </p><p class = \"textContentId2\">   Qualified & Trained Engineers </p>                 <p class = \"textContentId3\">  Trained staff in repairing household electrical points, fans, lights, wiring problem, short circuit issues etc. </p> <p class = \"textContentId4\">  Specialized engineers in branded & local large appliances like Geysers, Air Conditioners, Television, Refrigerators, Washing Machines </p>','/images/ico/mapicon/srv_electrician.jpg',12,0,0,1,'',NULL,'nbdimages/serviceicons/ico_electrician.png'),(5,'2015-08-10 09:28:59','2016-04-02 10:06:57','Up Keeping',NULL,'2','2',NULL,NULL,'/images/ico/mapicon/srv_up_keeping.jpg',10,1,0,0,'',NULL,NULL),(6,'2015-08-10 09:28:59','2016-03-17 15:26:35','PhysioTherapy','Be it a Sports injury or a lingering back pain, the treatment is possible in the comfort of your home.','1','21db609d-8a05-4a05-9f6d-4ef37e875ea8','pathologyOrder',' <img  src=\"nbdimages/images/physiotheraphy.png\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Injury? Pain? Arthritis? Surgery? and still being asked to travel to your physiotherapist.</h3><p class = \"textContentId1\"> Auro brings physiotherapy services at your doorstep  </p><p class = \"textContentId2\">   All physiotherapists use latest techniques and devices </p>                 <p class = \"textContentId3\">  100% certified with a masters degree in physiotherapy </p> <p class = \"textContentId4\">  Average experience more than 5 years </p>','/images/ico/mapicon/srv_physiotherapy.jpg',23,0,0,1,'',NULL,'nbdimages/serviceicons/ico_physiotheraphy.png'),(7,'2015-08-10 09:28:59','2016-03-17 15:26:35','Home Care Taker','Worried about your home in your absence? We have the best Care takers on whom you can trust on.','1','29d5b0e3-b3b0-4e43-8840-808750518242','pathologyOrder','<img  src=\"nbdimages/images/homecare-1.jpg\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Nursing is not just about health care, it is about caring. A little compassion, care helps healing. Auro brings to you the best nursing at home.</h3><p class = \"textContentId1\"> Fully certified senior nurse & home care services.  </p><p class = \"textContentId2\">   Qualified nurses in handling post surgery care, oxygen administration, injection, tracheostomy, wound care, suture removal, infusions etc. </p>                 <p class = \"textContentId3\">  Hourly/daily/weekly/monthly package. </p> <p class = \"textContentId4\">  Nurses trained in English and other languages. </p>','/images/ico/mapicon/srv_home_care_taker.jpg',28,0,0,1,'',NULL,'nbdimages/serviceicons/ico_home_care_taker.png'),(8,'2015-08-10 09:28:59','2016-04-02 10:06:57','Beauty',NULL,NULL,'3',NULL,NULL,'/images/ico/mapicon/srv_coming_soon.jpg',1,1,0,0,'',NULL,NULL),(9,'2015-08-10 09:28:59','2016-03-17 15:26:35','Pet Care','We have a dedicated and trained team who will take care of your pup from feeding to exercise and training.','2','5f0415dd-7e67-4d2c-bdb8-6a5b58c4f94e','pathologyOrder',' <img  src=\"nbdimages/images/petcare.png\" alt=\"petcare image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We all love our dogs. And who would not like to send them to school to be the smartest kid around. No need now we have a better solution for you now.</h3><p class = \"textContentId1\"> Get your pet groomed in your home from Aurodog groomers  </p><p class = \"textContentId2\"> Excellent experience of more than 5 years </p>                 <p class = \"textContentId3\">  Trained in making your dog, listen to you, caring loving and protective. </p> <p class = \"textContentId4\">  So what are you waiting for? Go ahead and pamper your pet. </p>','/images/ico/mapicon/srv_pet_care.jpg',16,0,0,1,'',NULL,'nbdimages/serviceicons/ico_pet_care.png'),(10,'2015-08-10 09:28:59','2016-03-17 15:26:35','Pathology','Feeling unsafe with diseases? Our specialists will provide you the best treatment along with diagnosis.','1','687a7dae-464f-43a0-a617-4f93a986949f','pathologyOrder','<img  src=\"nbdimages/images/pathalogy-1.png\" alt=\"pathology image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We will not let you waste your valued time in Labs, traffic posts and make multiple rounds of visits for collection of reports</h3><p class = \"textContentId1\"> Auro brings to you At Home Pathology Tests.  </p><p class = \"textContentId2\">   Now you can get your samples collected at the comfort of your home/office </p>                 <p class = \"textContentId3\">  NABL Certified Laboratories </p> <p class = \"textContentId4\">  Get test reports emailed to you right away </p><p class = \"textContentId5\">  Hard copies of test reports are couriered </p>','/images/ico/mapicon/srv_pathology.jpg',24,0,0,1,'',NULL,'nbdimages/serviceicons/ico_pathology.png'),(11,'2015-08-10 09:28:59','2016-03-17 15:26:35','Nursing Care','Not having enough time to look after your loved ones? We have best caring team who will look after your loved ones.','1','6aac2225-8b45-4df7-8875-f712c07f2d49','pathologyOrder',' <img  src=\"nbdimages/images/nursing-1.png\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Nursing is not just about health care, it is about caring. A little compassion, care helps healing. Auro brings to you the best nursing at home.</h3><p class = \"textContentId1\"> Fully certified senior nurse & home care services.  </p><p class = \"textContentId2\">   Qualified nurses in handling post surgery care, oxygen administration, injection, tracheostomy, wound care, suture removal, infusions etc. </p>                 <p class = \"textContentId3\">  Hourly/daily/weekly/monthly package. </p> <p class = \"textContentId4\">  Nurses trained in English and other languages. </p>','/images/ico/mapicon/srv_nursing_care.jpg',27,0,0,1,'',NULL,'nbdimages/serviceicons/ico_nursing_care.png'),(12,'2015-08-10 09:28:59','2016-03-17 15:26:35','Pest Control','Tired with pests all over the house? Hire the expert to safeguard your home from all kinds of pests.','2','730fbb84-7784-4369-bf8d-2dfcfe1c4cab','pathologyOrder','  <img  src=\"nbdimages/images/pestcontroller-1+.jpg\" alt=\"painter image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Be safe at home with your family not with pests. Auro brings the latest pest control solutions right at your doorstep.</h3><p class = \"textContentId1\"> Effective,long lasting herbal solutions  </p><p class = \"textContentId2\"> Money back guarantee if problem recurs in a week </p>                 <p class = \"textContentId3\">  Service guaranteed at the time of your convenience </p>','/images/ico/mapicon/srv_pest_control.jpg',15,0,0,1,'',NULL,'nbdimages/serviceicons/ico_pestcontrol.png'),(13,'2015-08-10 09:28:59','2016-03-17 15:26:35','Carpentry','All your home carpentry needs right from the scratch will be taken care by our best trained Carpenters.','2','80c1bbf0-f570-4604-a795-818076dd87e5','pathologyOrder',' <img  src=\"nbdimages/images/Carpenter-1.png\" alt=\"nursing image\" class=\"img-responsive imageName\" />               <h3 class = \"textContentId\"> Planning for a grand Pooja room? Or a wood cabinet?</h3>                 <p class = \"textContentId1\"> Auro provides you best carpenters from Rajasthan.  </p>                 <p class = \"textContentId2\">   More than 12 years of experience and finishing is best of the kind. </p>                 <p class = \"textContentId3\">  100% satisfaction guarantee </p>','/images/ico/mapicon/srv_carpentry.jpg',11,0,0,1,'',NULL,'nbdimages/serviceicons/ico_carpentry.png'),(14,'2015-08-10 09:28:59','2016-03-17 15:26:35','Plumber','Tired with fixing up the leaking tap again & again? Switch to experts. Book now!','2','a6c15070-aee6-40b9-bed6-48c844d86e18','pathologyOrder','  <img  src=\"nbdimages/images/plumber.jpg\" alt=\"plumber image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Leaking pipes, water logged drains and improper sanitary fittings causes a havoc. Meet our Auro Plumbers!</h3><p class = \"textContentId1\"> Quick and fast service guaranteed  </p><p class = \"textContentId2\"> Auro plumbers have an average experience of more than 20 years in plumbing </p>                 <p class = \"textContentId3\"> Trained in handling well known brands in sanitary ware which includes Jaguar, Cera, Hindware, Parryware, Kohler. </p>','/images/ico/mapicon/srv_plumber.jpg',13,0,0,1,'',NULL,'nbdimages/serviceicons/ico_plumber.png'),(15,'2015-08-10 09:28:59','2016-03-17 15:26:35','Painter','Seeking experts to paint your house? The experts are just one tap away from you. Book now!','2','dd8d1e0f-cbe3-44ff-9cbc-1497e1680437','pathologyOrder','  <img  src=\"nbdimages/images/painter-1.png\" alt=\"painter image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Want to convert a house into a home? Bored of old paint on the wall, exterior? Want to decorate your kids room?</h3><p class = \"textContentId1\"> Auro serves you with the best professionals to your residential and commercial complexes.  </p><p class = \"textContentId2\"> We provide painting services like wall painting, interior, exterior painting, wall decoration. </p>                 <p class = \"textContentId3\">  The average experience of painters is more than 5 years. </p> <p class = \"textContentId4\">  High quality work at affordable prices. </p>','/images/ico/mapicon/srv_painter.jpg',14,0,0,1,'',NULL,'nbdimages/serviceicons/ico_painter.png'),(16,'2015-08-10 09:28:59','2016-03-17 15:26:35','Fabrication','Be it a railing or a rolling shutter or a sliding gate, our experts will get it done for you.','2','f6e225dd-f7e1-4d68-a476-b885e37caf33','pathologyOrder','  <img  src=\"nbdimages/images/fabrication-1.png\" alt=\"fabrication image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Intricate furniture, beautiful painting, And old fashioned windows and fences</h3><p class = \"textContentId1\"> We have one stop solution for all you Fabrication needs - piping, rolling, sliding Gate, safety grills, window grills  </p><p class = \"textContentId2\">  Average experience of engineer more than 8 years </p>                 <p class = \"textContentId3\">  High quality finishing at affordable prices </p> ','/images/ico/mapicon/srv_fabrication.jpg',17,0,0,1,'',NULL,'nbdimages/serviceicons/ico_fabrication.png'),(32,NULL,'2016-03-17 15:26:35','CS','Looking for a trusted Chartered Accountant, get the best of them with just a tap of a click.','4',NULL,'pathologyOrder','\n<img  src=\"nbdimages/images/CS.jpg\" alt=\"company secretary\" class=\"img-responsive imageName\" />\n <h3 class = \"textContentId\"> Not sure of regulations and compliance issues for your business?</h3>\n<p class = \"textContentId1\"> As a small business, help us help you focus on your core business while our \n	professional company secretaries take care of regulatory compliances. </p>\n','/images/ico/mapicon/srv_cs.jpg',34,0,0,1,'',NULL,'nbdimages/serviceicons/ico_cs.png'),(33,NULL,'2016-04-02 10:06:57','Finance',NULL,NULL,NULL,NULL,NULL,'/images/ico/mapicon/srv_finance.jpg',33,1,0,0,'',NULL,NULL),(34,NULL,'2016-05-02 13:09:28','Home Cleaning','Feeling tired enough to clean your home. We have best home cleaning services who will refresh your home within a matter of time.','5',NULL,'pathologyOrder',' <img  src=\"nbdimages/images/cleaning.jpg\" alt=\"Home Cleaning\" class=\"img-responsive imageName\" />\n<h3 class = \"textContentId\"> Need professional help to clean your house?</h3>\n <p class = \"textContentId\"> If you need to get your house ready for a party, or need help in clearing out the after effects of a party, Auro\n professionals will help you  do the job at a time of your convenience. </p>\n\n <p  class = \"textContentId2\"> Order a home cleaning service from Auro. </p>','/images/ico/mapicon/srv_home_cleaning.jpg',19,0,0,1,'',NULL,'nbdimages/serviceicons/ico_home_cleaning_.png'),(35,NULL,'2016-04-02 10:06:57','Home Cleaning',NULL,NULL,NULL,NULL,' <img  src=\"nbdimages/images/cleaning.jpg\" alt=\"Home Cleaning\" class=\"img-responsive imageName\" />\n<h3 class = \"textContentId\"> Need professional help to clean your house?</h3>\n <p class = \"textContentId\"> If you need to get your house ready for a party, or need help in clearing out the after effects of a party, Auro\n professionals will help you  do the job at a time of your convenience. </p>\n\n <p  class = \"textContentId2\"> Order a home cleaning service from Auro. </p>','/images/ico/mapicon/srv_home_cleaning.jpg',18,1,0,0,'',NULL,NULL),(36,NULL,'2016-03-17 15:26:35','Wedding Planner','Behind every successful Weddings there are great wedding planners. Find them here.','6',NULL,'pathologyOrder','<img  src=\"nbdimages/images/wedding.jpg\" alt=\"yoga image\" class=\"img-responsive imageName\" />\n<h3 class = \"textContentId\"> Wedding is a path that paves way for two people into a beautiful journey called life.</h3>\n<p class = \"textContentId\"> In the special event of wedding, we make your work hassle free and we make sure that none miss the fun!!! </p>\n<p class = \"textContentId2\"> We at Aurospaces have professional wedding planners who make your wedding a special ceremony of love&happiness.</p>','/images/ico/mapicon/srv_wedding_planner.jpg',41,0,0,1,'',NULL,'nbdimages/serviceicons/ico_wedding_planner.png'),(37,NULL,'2016-04-02 10:06:57','Wedding',NULL,NULL,NULL,NULL,NULL,'/images/ico/mapicon/srv_wedding.jpg',40,1,0,0,'',NULL,NULL),(38,NULL,'2016-03-17 15:26:35','Carpet Cleaning','Get your carpets cleaned by experienced professionals being in the comfort of your home.','5',NULL,'pathologyOrder','<img  src=\"nbdimages/images/carpet cleaning.jpg\" alt=\"yoga image\" class=\"img-responsive imageName\" />\n<h3 class = \"textContentId\"> Your healthy home starts here with AURO</h3>\n<p class = \"textContentId\"> At Auro we promise you to provide the cleanest healthiest long lasting carpet cleaning service with our experts here.</p>','/images/ico/mapicon/srv_carpet_cleaning.jpg',20,0,0,1,'',NULL,'nbdimages/serviceicons/ico_carpet_cleaning.png'),(39,NULL,'2016-03-17 15:26:35','Dietician','Gaining weight day by day or having fear of losing it? Leave the worries to experts to get fit again.','7',NULL,'pathologyOrder','\n<img  src=\"nbdimages/images/dietician.jpg\" alt=\"yoga image\" class=\"img-responsive imageName\" />\n <h3 class = \"textContentId\"> Worried about your unmanageable diet?</h3>\n  <p class = \"textContentId\"> Dealing with weight issues? Eating too much or too little? Unable to contain hunger pangs due to your diet?\n	Unable to stay away from binge eating? </p>\n\n	<p  class = \"textContentId2\"> Get a professional dietician from Auro to help you deal with your diet issues.</p>\n	','/images/ico/mapicon/srv_dietician.jpg',32,0,0,1,'',NULL,'nbdimages/serviceicons/ico_dietician.png'),(40,NULL,'2016-03-17 15:26:35','Yoga','Want to get fit again? Get the professional yoga experts at your doorstep with just a click.','7',NULL,'pathologyOrder','<img  src=\"nbdimages/images/yoga.jpg\" alt=\"yoga image\" class=\"img-responsive imageName\" />\n  <h3 class = \"textContentId\"> Looking for Professional Yoga guidance?</h3>\n	 <p class = \"textContentId1\">  We have the best yoga professionals </p>\n	  <p class = \"textContentId2\">  Flexible packages to suit every need</p>\n		 <p class = \"textContentId3\">  Learn Yoga under their guidance from the comfort of your home.</p>','/images/ico/mapicon/srv_yoga.jpg',31,0,0,1,'',NULL,'nbdimages/serviceicons/ico_yoga.png'),(41,NULL,'2016-03-17 15:26:35','Car Detailing','From cleaning to restoration both inside and out, experts will make your car look beautiful with hygiene and protection .','8',NULL,'pathologyOrder','\n<img  src=\"nbdimages/images/car_wash.jpg\" alt=\"Car Detailing\" class=\"img-responsive imageName\" />\n <h3 class = \"textContentId\"> An extra special way to cleanse, condition and protect your car.</h3>\n  <p class = \"textContentId1\">\n	A car is a pride and passion,  of everyone and we care for it. </p>\n	 <p class = \"textContentId2\">\n	 We provide the best car detailing service by cleansing , polishing and waxing the complete car because we know YOU LOVE YOUR CAR & WE LOVE OUR CUSTOMERS!!!\n	 </p>','/images/ico/mapicon/srv_car_detailing.jpg',37,0,0,1,'',NULL,'nbdimages/serviceicons/ico_car_detailing.png'),(42,NULL,'2016-04-