i_16.jpg',1),(2358,'2016-05-04 13:11:15','2016-05-06 05:47:53',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (1 Day)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house(North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_11.jpg',1),(2359,'2016-05-04 13:12:13','2016-05-05 07:09:00',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (2 Days)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house(North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2360,'2016-05-04 13:13:00','2016-05-05 07:09:21',NULL,55,251,'Saraswati Puja','Saraswati puja is a very important puja. If you please the Goddess Saraswati she can grant you with a lot of knowledge and talents. The people who are affected by Rahu must worship the goddess Saraswati regularl(North Indian)','North Indian','nbdimages/mobile/package/pujari/poojari_13.jpg',1),(2361,'2016-05-04 13:13:44','2016-05-05 07:10:10',NULL,55,251,'Shradha(Without Homa)','The ritual of Shraddha not only repays debts towards deceased ancestors, but also makes it easy to repay debts towards God and Sages. As debts towards ancestors need to be repaid by actions, it becomes simple and easy to repay these debts through the ritual of Shraddha. Therefore, in order to be able to repay other debts in a good manner, it is necessary that everyone relies upon debts towards ancestors that acts as link between God and Sages, satisfy them by performing these rituals and try to embark upon the progress towards attaining final liberation(North Indian)','North Indian','nbdimages/mobile/package/pujari/poojari_01.jpg',1),(2362,'2016-05-04 13:14:21','2016-05-05 07:09:38',NULL,55,251,'Mrithyunjaya Homa','Maha Mruthyunjaya Homam is dedicated to Lord Shiva to avoid untimely death. The Mruthyunjaya Homam is performed to achieve Jaya or Victory over Mritya or death. The object of worship of this homa is Lord Shiva. One of the synonyms of Lord Shiva is Mrityu. Mrityu which means death of the death or the destroyer of death. During this homa one chants 21 mantras. The prominent offerings in this homa are durva grass and an herb called amrita(North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_15.jpg',1),(2363,'2016-05-04 13:15:01','2016-05-05 09:10:21',NULL,55,251,'Dhanalakshmi Puja','Lakshmi puja is one of the important rituals performed during the festival of Diwali. This ritual is performed to invite Goddess Lakshmi at home. Prayers are offered to the Goddess, so that the New Year (Hindu New Year) is filled with peace, wealth and prosperity(North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_09.jpg',1),(2364,'2016-05-04 13:15:42','2016-05-05 09:10:38',NULL,55,251,'Navagraha Puja','The Navagraha play a vital role in deciding the course of our lives. If 4 or more of the planets are not well placed in ones natal chart, Navagraha homam should be performed.It is also performed if Rahu (Ascending node) and Ketu (Descending node) are afflicted. Navagraha homam is performed if one has kalathra dosha or kala sarpha dosha.The dosha should be nullified to improve marital life and career(North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_07.jpg',1),(2365,'2016-05-04 13:16:22','2016-05-05 09:11:01',NULL,55,251,'\"Lakshmi Puja on Fridays  (Office -4 Weeks)\"','Lakshmi puja is one of the important rituals performed during the festival of Diwali. This ritual is performed to invite Goddess Lakshmi at home. Prayers are offered to the Goddess, so that the New Year (Hindu New Year) is filled with peace, wealth and prosperity(North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_14.jpg',1),(2367,'2016-05-04 13:16:59','2016-05-05 09:12:37',NULL,55,251,'\"Office Opening Puja  (Karyalay Pravesh)\"','Business Inauguration Ceremony is a special pooja done to ensure the success of the Company and performing inaugural pooja with Lord Ganesha (North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_01.jpg',1),(2368,'2016-05-04 13:17:44','2016-05-23 12:56:00',NULL,55,251,'Bhoomi Puja','The earth is considered a sacred element in Hinduism and is personified as a Mother Goddess or Bhoomi. Bhoomi Pooja is an important ritual that is devoted to the worship of the earth. It is necessary to worship the land before construction work starts.This puja helps in taking his and other God is blessings ensuring the safety and well being of the people who are going to acquire the land (North Indian)','North Indian','nbdimages/mobile/package/pujari/poojari_06.jpg',1),(2370,'2016-05-04 13:18:20','2016-05-23 12:45:05',NULL,55,251,'Marriage (Groom side)-One day','Marriage, also called matrimony or wedlock, is a socially or ritually recognized union or legal contract between spouses that establishes rights and obligations between them, and their children,  and their in-laws as well as society in general. A very simple pooja if done with pure devotion to Lord Shiva will bless you with peaceful married life and harmony in family (North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_17.jpg',1),(2372,'2016-05-04 13:18:51','2016-05-05 09:14:07',NULL,55,251,'Marriage (Bride side)-One day','Marriage, also called matrimony or wedlock, is a socially or ritually recognized union or legal contract between spouses that establishes rights and obligations between them, between them and their children, and between them and their in-laws as well as society in general. A very simple pooja if done with pure devotion to Lord Shiva will bless you with peaceful married life and harmony in family.It includes Kalash Puja ,Navrgrah puja and Kanyadan North IIndian .','North Indian','nbdimages/mobile/package/pujari/poojari_03.jpg',1),(2373,'2016-05-04 13:19:48','2016-05-05 09:02:08',NULL,55,251,'Upanayan/Brahmopadesham/ Thread Ceremony','Upanayana is the samskara, the ceremonial ritual by which the young boy is invested with the sacred thread and soon after initiated into the celebrated Gayatri Mantra. Gayatri is the holiest of all the mantras and is a priceless legacy handed down to us from our ancient sages. Only after the upanayana is performed, can the boy be eligible to study the Vedas. This samskara signifies a spiritual rebirth as it were. After the Upanayana is performed the young lad becomes a dvija i.e. twice born (North Indian) .','North Indian','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2374,'2016-05-04 13:20:18','2016-05-05 09:05:45',NULL,55,251,'\"Naamakaranam/Naming  Ceremony (without homa)\"','A naming ceremony is the event at which an infant, a youth, or an adult is given a name or names. The timing can vary from mere days after birth to several months or many years afterwards. Some of these ceremonies have religious or cultural significance (North Indian ).','North Indian','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2377,'2016-05-04 14:09:36','2016-05-05 09:06:01',NULL,55,251,'Navagraha Homa','It is very useful since this Pujas strengthens benefic planets and pacifies malefic planets. This Pujas increases the positive influence of benefic planets and also neutralizes the negative effect of malefic planets. Navagraha Pujas is basically a combined Pujas for all nine Graha or planets (North Indian).','North Indian','nbdimages/mobile/package/pujari/poojari_08.jpg',1),(2379,'2016-05-04 14:10:36','2016-05-05 09:06:28',NULL,55,251,'Sudar