their children, and between them and their in-laws as well as society in general. A very simple pooja if done with pure devotion to Lord Shiva will bless you with peaceful married life and harmony in family.It includes Kalash Puja ,Navrgrah puja and Kanyadan (Marathi).','Marathi','nbdimages/mobile/package/pujari/poojari_03.jpg',1),(2437,'2016-05-04 14:35:23','2016-05-23 12:56:57',NULL,55,251,'Upanayan/Brahmopadesham/ Thread Ceremony','Upanayana is the samskara, the ceremonial ritual by which the young boy is invested with the sacred thread and soon after initiated into the celebrated Gayatri Mantra. Gayatri is the holiest of all the mantras and is a priceless legacy handed down to us from our ancient sages. Only after the upanayana is performed, can the boy be eligible to study the Vedas. This samskara signifies a spiritual rebirth as it were. After the Upanayana is performed the young lad becomes a dvija i.e. twice born (Marathi).','Marathi','nbdimages/mobile/package/pujari/poojari_15.jpg',1),(2439,'2016-05-04 14:36:21','2016-05-06 10:02:46',NULL,55,251,'Naamakaranam/Naming  Ceremony (without homa)','A naming ceremony is the event at which an infant, a youth, or an adult is given a name or names. The timing can vary from mere days after birth to several months or many years afterwards. Some of these ceremonies have religious or cultural significance (Marathi).','Marathi','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2440,'2016-05-04 14:36:55','2016-05-05 09:14:59',NULL,55,251,'Navagraha Homa','It is very useful since this Pujas strengthens benefic planets and pacifies malefic planets. This Pujas increases the positive influence of benefic planets and also neutralizes the negative effect of malefic planets. Navagraha Pujas is basically a combined Pujas for all nine Graha or planets (Marathi).','Marathi','nbdimages/mobile/package/pujari/poojari_08.jpg',1),(2441,'2016-05-04 14:38:26','2016-05-05 09:15:21',NULL,55,251,'Sudarshana Homa','The Sudarshana Chakra contains healing characteristics. Therefore performing Sudarshana Homa relieves you from afflictions of fever and unknown health sufferings. This is the appropriate Homa which is conducted to vanquish your enemies and protects you from harmful things, fear of ire things, negative chants, evil eye etc (Marathi).','Marathi','nbdimages/mobile/package/pujari/poojari_20.jpg',1),(2442,'2016-05-04 14:39:40','2016-05-05 09:15:49',NULL,55,251,'Gana Homa','Ganapati Homa helps to remove whatever obstacles we are facing in our life or before starting any new venture (example: starting new business or getting married, etc) or anything afresh. Performing Ganapati Homa once in every year brings, prosperity, health, wealth and unity in family. Also this homa is recommended for the people undergoing through Kethu major period (Marathi).','Marathi','nbdimages/mobile/package/pujari/poojari_11.jpg',1),(2443,'2016-05-04 14:41:35','2016-05-05 09:16:34',NULL,55,251,'Satyanarayan Puja','Satyanarayan Pooja is one of the best & easiest ways to seek blessings from Lord Vishnu, who is the God responsible for maintenance of this Universe. Typically Satyanarayan Pooja is to be performed before and/or after the fulfillment of our desires e.g. if you want to achieve some important milestones in your life like success in Higher Education, Success in career, promotion, buying a new vehicle, new house, starting a new business, negotiating big professional deals etc... (Marathi)','Marathi','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2445,'2016-05-04 14:42:27','2016-05-05 09:17:12',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (Budget)','Graha - ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house (Iyer).','Iye