he following circumstances to avoid adverse effect (circumstances) by nature and environment. When one chooses against Vaastu parameters. Construction of building against the Vaastu rules and money short comings remain in the structure. Due to errors in interior arrangement of concerned rooms and buildings. When someone buys an old home (Oriya).','Oriya','nbdimages/mobile/package/pujari/poojari_11.jpg',1),(2492,'2016-05-04 15:15:12','2016-05-05 10:18:55',NULL,55,251,'Sudarshana Homa','The Sudarshana Chakra contains healing characteristics. Therefore performing Sudarshana Homa relieves you from afflictions of fever and unknown health sufferings. This is the appropriate Homa which is conducted to vanquish your enemies and protects you from harmful things, fear of ire things, negative chants, evil eye etc (Oriya).','Oriya','nbdimages/mobile/package/pujari/poojari_16.jpg',1),(2493,'2016-05-04 15:15:39','2016-05-05 10:19:14',NULL,55,251,'Gana Homa','Ganapati Homa helps to remove whatever obstacles we are facing in our life or before starting any new venture (example: starting new business or getting married, etc) or anything afresh. Performing Ganapati Homa once in every year brings, prosperity, health, wealth and unity in family. Also this homa is recommended for the people undergoing through Kethu major period (Oriya).','Oriya','nbdimages/mobile/package/pujari/poojari_12.jpg',1),(2494,'2016-05-04 15:16:26','2016-05-05 10:19:35',NULL,55,251,'Satyanarayan Puja','Satyanarayan Pooja is one of the best & easiest ways to seek blessings from Lord Vishnu, who is the God responsible for maintenance of this Universe. Typically Satyanarayan Pooja is to be performed before and/or after the fulfillment of our desires e.g. if you want to achieve some important milestones in your life like success in Higher Education, Success in career, promotion, buying a new vehicle, new house, starting a new business, negotiating big professional deals etc... (Oriya)','Oriya','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2495,'2016-05-04 15:19:10','2016-05-05 10:22:17',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (Budget)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house (Bengali).','Bengali','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2496,'2016-05-04 15:19:42','2016-05-05 10:22:31',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (1 Day)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house (Bengali).','Bengali','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2497,'2016-05-04 15:20:21','2016-05-05 10:22:43',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (2 Days)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house (Bengali).','Bengali','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2498,'2016-05-04 15:21:33','2016-05-05 10:22:56',NULL,55,251,'Saraswati Puja','Saraswati puja is a very important puja. If you please the Goddess Saraswati she can grant you with a lot of knowledge and talents. The people who are affected by Rahu must worship the goddess Saraswati regularl (Bengali)','Bengali','nbdimages/mobile/package/pujari/poojari_18.jpg',1),(2499,'2016-05-04 15:22:02','2016-05-05 10:23:14',NULL,55,251,'Shradha(Without Homa)','The ritual of Shraddha not only repays debts towards deceased ancestors, but also makes it easy to repay debts towards God and Sages. As debts towards ancestors need to be repaid by actions, it becomes simple and easy to repay these debts through the ritual of Shraddha. Therefore, in order to be able to repay other debts in a good manner, it is necessary that everyone relies upon debts towards ancestors that acts as link between God and Sages, satisfy them by performing these rituals and try to embark upon the progress towards attaining final liberation(Bengali)','Bengali','nbdimages/mobile/package/pujari/poojari_12.jpg',1),(2500,'2016-05-04 15:23:21','2016-05-05 10:23:24',NULL,55,251,'Mrithyunjaya Homa','Maha Mruthyunjaya Homam is dedicated to Lord Shiva to avoid untimely death. The Mruthyunjaya Homam is performed to achieve Jaya or Victory over Mritya or death. The object of worship of this homa is Lord Shiva. One of the synonyms of Lord Shiva is Mrityu. Mrityu which means death of the death or the destroyer of death. During this homa one chants 21 mantras. The prominent offerings in this homa are durva grass and an herb called amrita (Bengali).','Bengali','nbdimages/mobile/package/pujari/poojari_16.jpg',1),(2501,'2016-05-04 15:23:46','2016-05-05 10:23:35',NULL,55,251,'Dhanalakshmi Puja','Lakshmi puja is one of the important rituals performed during the festival of Diwali. This ritual is performed to invite Goddess Lakshmi at home. Prayers are offered to the Goddess, so that the New Year (Hindu New Year) is filled with peace, wealth and prosperity (Bengali).','Bengali','nbdimages/mobile/package/pujari/poojari_09.jpg',1),(2503,'2016-05-04 15:24:09','2016-05-05 10:28:37',NULL,55,251,'Navagraha Puja','The Navagraha play a vital role in deciding the course of our lives. If 4 or more of the planets are not well placed in ones natal chart, Navagraha homam should be perfor