siness or getting married, etc) or anything afresh. Performing Ganapati Homa once in every year brings, prosperity, health, wealth and unity in family. Also this homa is recommended for the people undergoing through Kethu major period(Arya Vysya).','Arya Vysya','nbdimages/mobile/package/pujari/poojari_15.jpg',1),(2585,'2016-05-04 15:53:32','2016-05-06 06:45:55',NULL,55,251,'Satyanarayan Puja','Satyanarayan Pooja is one of the best & easiest ways to seek blessings from Lord Vishnu, who is the God responsible for maintenance of this Universe. Typically Satyanarayan Pooja is to be performed before and/or after the fulfillment of our desires e.g. if you want to achieve some important milestones in your life like success in Higher Education, Success in career, promotion, buying a new vehicle, new house, starting a new business, negotiating big professional deals etc..(Arya Vysya)','Arya Vysya','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2586,'2016-05-04 15:54:27','2016-05-06 06:48:51',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (Budget)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house(Smartha-Kannada).','Smartha-Kannada','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2587,'2016-05-04 15:55:10','2016-05-06 06:48:59',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (1 Day)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house(Smartha-Kannada).','Smartha-Kannada','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2588,'2016-05-04 15:55:55','2016-05-06 06:49:05',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (2 Days)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house(Smartha-Kannada).','Smartha-Kannada','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2589,'2016-05-04 15:56:58','2016-05-06 06:49:28',NULL,55,251,'Saraswati Puja','Saraswati puja is a very important puja. If you please the Goddess Saraswati she can grant you with a lot of knowledge and talents. The people who are affected by Rahu must worship the goddess Saraswati regularl(Smartha-Kannada)','Smartha-Kannada','nbdimages/mobile/package/pujari/poojari_18.jpg',1),(2590,'2016-05-04 15:57:45','2016-05-06 06:49:51',NULL,55,251,'Shradha(Without Homa)','The ritual of Shraddha not only repays debts towards deceased ancestors, but also makes it easy to repay debts towards God and Sages. As debts towards ancestors need to be repaid by actions, it becomes simple and easy to repay these debts through the ritual of Shraddha. Therefore, in order to be able to repay other debts in a good manner, it is necessary that everyone relies upon debts towards ancestors that acts as link between God and Sages, satisfy them by performing these rituals and try to embark upon the progress towards attaining final liberation(Smartha-Kannada)','Smartha-Kannada','nbdimages/mobile/package/pujari/poojari_15.jpg',1),(2591,'2016-05-04 15:58:26','2016-05-06 06:50:04',NULL,55,251,'Mrithyunjaya Homa','Maha Mruthyunjaya Homam is dedicated to Lord Shiva to avoid untimely death. The Mruthyunjaya Homam is performed to achieve Jaya or Victory over Mritya or death. The object of worship of thi