51,'Gana Homa','Ganapati Homa helps to remove whatever obstacles we are facing in our life or before starting any new venture (example: starting new business or getting married, etc) or anything afresh. Performing Ganapati Homa once in every year brings, prosperity, health, wealth and unity in family. Also this homa is recommended for the people undergoing through Kethu major period (Smartha-Telugu).','Smartha-Telugu','nbdimages/mobile/package/pujari/poojari_15.jpg',1),(2643,'2016-05-04 16:40:12','2016-05-05 09:28:19',NULL,55,251,'Satyanarayan Puja','Satyanarayan Pooja is one of the best & easiest ways to seek blessings from Lord Vishnu, who is the God responsible for maintenance of this Universe. Typically Satyanarayan Pooja is to be performed before and/or after the fulfillment of our desires e.g. if you want to achieve some important milestones in your life like success in Higher Education, Success in career, promotion, buying a new vehicle, new house, starting a new business, negotiating big professional deals etc... (Smartha-Telugu)','Smartha-Telugu','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2647,'2016-05-04 16:41:40','2016-05-17 10:23:54',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (Budget)','Graha Pravesh ceremony needs to be performed at some auspicious time ( Madva) as per Panchang. (Madva ) ','Madva','nbdimages/mobile/package/pujari/poojari_16.jpg',1),(2648,'2016-05-04 16:42:48','2016-05-05 09:28:36',NULL,55,251,'\"Griha Pravesham /House-warming  Ceremony (1 Day)\"','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_16.jpg',1),(2649,'2016-05-04 16:48:03','2016-05-05 09:28:43',NULL,55,251,'Griha Pravesham /House-warming  Ceremony (2 Days)','Graha Pravesh ceremony needs to be performed at some auspicious time ( muhurata) as per Panchang. The prerequisite of Graha Pravesha is to perform the Vaastu pooja for Vaastu Devata outside the house before the entry into the house.In order to lessen the effects of the negative forces,it is required to do the Vastu Pooja before entering the house (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_16.jpg',1),(2651,'2016-05-04 16:48:33','2016-05-05 09:28:52',NULL,55,251,'Saraswati Puja','Saraswati puja is a very important puja. If you please the Goddess Saraswati she can grant you with a lot of knowledge and talents. The people who are affected by Rahu must worship the goddess Saraswati regularl (Madva)','Madva','nbdimages/mobile/package/pujari/poojari_13.jpg',1),(2653,'2016-05-04 16:49:01','2016-05-05 09:29:13',NULL,55,251,'Shradha(Without Homa)','The ritual of Shraddha not only repays debts towards deceased ancestors, but also makes it easy to repay debts towards God and Sages. As debts towards ancestors need to be repaid by actions, it becomes simple and easy to repay these debts through the ritual of Shraddha. Therefore, in order to be able to repay other debts in a good manner, it is necessary that everyone relies upon debts towards ancestors that acts as link between God and Sages, satisfy them by performing these rituals and try to embark upon the progress towards attaining final liberation (Madva)','Madva','nbdimages/mobile/package/pujari/poojari_14.jpg',1),(2654,'2016-05-04 16:49:27','2016-05-05 09:29:24',NULL,55,251,'Mrithyunjaya Homa','Maha Mruthyunjaya Homam is dedicated to Lord Shiva to avoid untimely death. The Mruthyunjaya Homam is performed to achieve Jaya or Victory over Mritya or death. The object of worship of this homa is Lord Shiva. One of the synonyms of Lord Shiva is Mrityu. Mrityu which means death of the death or the destroyer of death. During this homa one chants 21 mantras. The prominent offerings in this homa are durva grass and an herb called amrita (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_16.jpg',1),(2656,'2016-05-04 16:50:01','2016-05-05 09:22:32',NULL,55,251,'Dhanalakshmi Puja','Lakshmi puja is one of the important rituals performed during the festival of Diwali. This ritual is performed to invite Goddess Lakshmi at home. Prayers are offered to the Goddess, so that the New Year (Hindu New Year) is filled with peace, wealth and prosperity (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_09.jpg',1),(2657,'2016-05-04 16:50:26','2016-05-05 09:26:23',NULL,55,251,'Navagraha Puja','The Navagraha play a vital role in deciding the course of our lives. If 4 or more of the planets are not well placed in ones natal chart, Navagraha homam should be performed.It is also performed if Rahu (Ascending node) and Ketu (Descending node) are afflicted. Navagraha homam is performed if one has kalathra dosha or kala sarpha dosha.The dosha should be nullified to improve marital life and career (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_08.jpg',1),(2658,'2016-05-04 16:51:04','2016-05-05 09:26:32',NULL,55,251,'Lakshmi Puja on Fridays  (Office -4 Weeks)','Lakshmi puja is one of the important rituals performed during the festival of Diwali. This ritual is performed to invite Goddess Lakshmi at home. Prayers are offered to the Goddess, so that the New Year (Hindu New Year) is filled with peace, wealth and prosperity (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_09.jpg',1),(2660,'2016-05-04 16:51:36','2016-05-05 09:27:02',NULL,55,251,'Office Opening Puja  (Karyalay Pravesh)','Business Inauguration Ceremony is a special pooja done to ensure the success of the Company and performing inaugural pooja with Lord Ganesha (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_01.jpg',1),(2661,'2016-05-04 16:52:03','2016-05-05 09:27:32',NULL,55,251,'Bhoomi Puja','The earth is considered a sacred element in Hinduism and is personified as a Mother Goddess or Bhoomi. Bhoomi Pooja is an important ritual that is devoted to the worship of the earth. It is necessary to worship the land before construction work starts.This puja helps in taking his and other God??s blessings ensuring the safety and well being of the people who are going to acquire the land.(Madva)','Madva','nbdimages/mobile/package/pujari/poojari_06.jpg',1),(2662,'2016-05-04 16:52:30','2016-05-05 09:28:01',NULL,55,251,'BhooMarriage (Groom side)-One daymi Puja','Marriage, also called matrimony or wedlock, is a socially or ritually recognized union or legal contract between spouses that establishes rights and obligations between them, between them and their children, and between them and their in-laws,] as well as society in general. A very simple pooja if done with pure devotion to Lord Shiva will bless you with peaceful married life and harmony in family (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_16.jpg',1),(2663,'2016-05-04 16:52:55','2016-05-05 09:28:06',NULL,55,251,'Marriage (Bride side)-One day','Marriage, also called matrimony or wedlock, is a socially or ritually recognized union or legal contract between spouses that establishes rights and obligations between them, between them and their children, and between them and their in-laws as well as society in general. A very simple pooja if done with pure devotion to Lord Shiva will bless you with peaceful married life and harmony in family.It includes Kalash Puja ,Navrgrah puja and Kanyadan (Madva).','Madva','nbdimages/mobile/package/pujari/poojari_17.jpg',1),(2665,'2016-05-04 16:53:30','2016-05-23 13:05:13',NULL,55,251,'Upanayan/Brahmopadesham/ Thread Ceremony','Upanayana is the samskara, the ceremonial ritual by which the young boy is invested with the sacred thread and soon after initiated into the celebrated Gayatri Mantra. Gayatri is the holiest of all the mantras and is a priceless legacy handed down to us from our ancient sages. Only after