ffected by Rahu must worship the goddess Saraswati regularl (GSB). ','GSB','nbdimages/mobile/package/pujari/poojari_13.jpg',1),(2711,'2016-05-04 18:14:59','2016-05-05 09:05:43',NULL,55,251,'Shradha(Without Homa)','The ritual of Shraddha not only repays debts towards deceased ancestors, but also makes it easy to repay debts towards God and Sages. As debts towards ancestors need to be repaid by actions, it becomes simple and easy to repay these debts through the ritual of Shraddha. Therefore, in order to be able to repay other debts in a good manner, it is necessary that everyone relies upon debts towards ancestors that acts as link between God and Sages, satisfy them by performing these rituals and try to embark upon the progress towards attaining final liberation (GSB)','GSB','nbdimages/mobile/package/pujari/poojari_01.jpg',1),(2712,'2016-05-04 18:15:38','2016-05-05 09:05:53',NULL,55,251,'Mrithyunjaya Homa','Maha Mruthyunjaya Homam is dedicated to Lord Shiva to avoid untimely death. The Mruthyunjaya Homam is performed to achieve Jaya or Victory over Mritya or death. The object of worship of this homa is Lord Shiva. One of the synonyms of Lord Shiva is Mrityu. Mrityu which means death of the death or the destroyer of death. During this homa one chants 21 mantras. The prominent offerings in this homa are durva grass and an herb called amrita (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_20.jpg',1),(2713,'2016-05-04 18:16:11','2016-05-05 09:08:23',NULL,55,251,'Dhanalakshmi Puja','Lakshmi puja is one of the important rituals performed during the festival of Diwali. This ritual is performed to invite Goddess Lakshmi at home. Prayers are offered to the Goddess, so that the New Year (Hindu New Year) is filled with peace, wealth and prosperity (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_13.jpg',1),(2714,'2016-05-04 18:16:36','2016-05-05 09:08:32',NULL,55,251,'Navagraha Puja','The Navagraha play a vital role in deciding the course of our lives. If 4 or more of the planets are not well placed in ones natal chart, Navagraha homam should be performed.It is also performed if Rahu (Ascending node) and Ketu (Descending node) are afflicted. Navagraha homam is performed if one has kalathra dosha or kala sarpha dosha.The dosha should be nullified to improve marital life and career (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_07.jpg',1),(2715,'2016-05-04 18:17:09','2016-05-05 09:09:23',NULL,55,251,'Lakshmi Puja on Fridays  (Office -4 Weeks)','Lakshmi puja is one of the important rituals performed during the festival of Diwali. This ritual is performed to invite Goddess Lakshmi at home. Prayers are offered to the Goddess, so that the New Year (Hindu New Year) is filled with peace, wealth and prosperity (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_09.jpg',1),(2716,'2016-05-04 18:17:41','2016-05-05 09:09:32',NULL,55,251,'Office Opening Puja  (Karyalay Pravesh)','Business Inauguration Ceremony is a special pooja done to ensure the success of the Company and performing inaugural pooja with Lord Ganesha (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2717,'2016-05-04 18:18:29','2016-05-23 12:54:04',NULL,55,251,'Bhoomi Puja','The earth is considered a sacred element in Hinduism and is personified as a Mother Goddess or Bhoomi. Bhoomi Pooja is an important ritual that is devoted to the worship of the earth. It is necessary to worship the land before construction work starts.This puja helps in taking his and other God is blessings ensuring the safety and well being of the people who are going to acquire the land (GSB). ','GSB','nbdimages/mobile/package/pujari/poojari_06.jpg',1),(2718,'2016-05-04 18:19:03','2016-05-06 10:07:39',NULL,55,251,'Marriage (Groom side)-One day','Marriage, also called matrimony or wedlock, is a socially or ritually recognized union or legal contract between spouses that establishes rights and obligations and their children and their in-laws as well as society in general. A very simple pooja if done with pure devotion to Lord Shiva will bless you with peaceful married life and harmony in family (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_17.jpg',1),(2719,'2016-05-04 18:19:26','2016-05-06 10:08:34',NULL,55,251,'Marriage (Bride side)-One day','Marriage, also called matrimony or wedlock, is a socially or ritually recognized union or legal contract between spouses that establishes rights and obligations and their children and their in-laws  as well as society in general. A very simple pooja if done with pure devotion to Lord Shiva will bless you with peaceful married life and harmony in family (GSB) .','GSB','nbdimages/mobile/package/pujari/poojari_21.jpg',1),(2720,'2016-05-04 18:20:00','2016-05-23 12:54:54',NULL,55,251,'Upanayan/Brahmopadesham/ Thread Ceremony','Upanayana is the samskara, the ceremonial ritual by which the young boy is invested with the sacred thread and soon after initiated into the celebrated Gayatri Mantra. Gayatri is the holiest of all the mantras and is a priceless legacy handed down to us from our ancient sages. Only after the upanayana is performed, can the boy be eligible to study the Vedas. This samskara signifies a spiritual rebirth as it were. After the Upanayana is performed the young lad becomes a dvija i.e. twice born (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_05.jpg',1),(2721,'2016-05-04 18:20:37','2016-05-05 09:04:37',NULL,55,251,'Naamakaranam/Naming  Ceremony (without homa)','A naming ceremony is the event at which an infant, a youth, or an adult is given a name or names. The timing can vary from mere days after birth to several months or many years afterwards. Some of these ceremonies have religious or cultural significance (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_22.jpg',1),(2722,'2016-05-04 18:21:03','2016-05-05 09:04:46',NULL,55,251,'Navagraha Homa','It is very useful since this Pujas strengthens benefic planets and pacifies malefic planets. This Pujas increases 