ja is one of the best & easiest ways to seek blessings from Lord Vishnu, who is the God responsible for maintenance of this Universe. Typically Satyanarayan Pooja is to be performed before and/or after the fulfillment of our desires e.g. if you want to achieve some important milestones in your life like success in Higher Education, Success in career, promotion, buying a new vehicle, new house, starting a new business, negotiating big professional deals etc (GSB).','GSB','nbdimages/mobile/package/pujari/poojari_199.jpg',1),(2727,'2016-05-06 12:34:41','2016-05-06 09:20:45',NULL,51,195,'Curtain large','Dry cleaning is any cleaning process for clothing and textiles using a chemical solvent other than water. The solvent used is typically toxic tetrachloroethylene (perchloroethylene), which the industry calls \"perc\" or \"PERC\". It is used to clean delicate fabrics that cannot withstand the rough and tumble of a washing machine and clothes dryer; it can also eliminate labor-intensive hand washing. \"Perc\" is the most widely used solvent across the world, although new solvents have become more popular in the United States and Europe; including hydrocarbons, Green Earth, and Solvon K4 (Household).','Household','nbdimages/mobile/package/laundry/laundry_easy_wash.jpg',1),(2728,'2016-05-06 12:36:24','2016-05-09 09:20:04',NULL,51,195,'Curtain medium','Dry cleaning is any cleaning process for clothing and textiles using a chemical solvent other than water. The solvent used is typically toxic tetrachloroethylene (perchloroethylene), which the industry calls \"perc\" or \"PERC\". It is used to clean delicate fabrics that cannot withstand the rough and tumble of a washing machine and clothes dryer; it can also eliminate labor-intensive hand washing. \"Perc\" is the most widely used solvent across the world, although new solvents have become more popular in the United States and Europe; including hydrocarbons, Green Earth, and Solvon K4 (Household).','Household','nbdimages/mobile